import{_ as a,c as t,o,ae as r}from"./chunks/framework.BtEkjhVd.js";const k=JSON.parse('{"title":"DeepSeek 对接指南","description":"","frontmatter":{},"headers":[],"relativePath":"BiliIns/AI-Api/DeepSeek.md","filePath":"BiliIns/AI-Api/DeepSeek.md"}'),s={name:"BiliIns/AI-Api/DeepSeek.md"};function p(i,e,d,c,l,n){return o(),t("div",null,e[0]||(e[0]=[r('<h1 id="deepseek-对接指南" tabindex="-1">DeepSeek 对接指南 <a class="header-anchor" href="#deepseek-对接指南" aria-label="Permalink to &quot;DeepSeek 对接指南&quot;">​</a></h1><h2 id="获取deepseek密钥" tabindex="-1">获取DeepSeek密钥 <a class="header-anchor" href="#获取deepseek密钥" aria-label="Permalink to &quot;获取DeepSeek密钥&quot;">​</a></h2><h3 id="注册deepseek开放平台账号" tabindex="-1">注册DeepSeek开放平台账号 <a class="header-anchor" href="#注册deepseek开放平台账号" aria-label="Permalink to &quot;注册DeepSeek开放平台账号&quot;">​</a></h3><p>访问<a href="https://platform.deepseek.com/" target="_blank" rel="noreferrer">https://platform.deepseek.com/</a>注册DeepSeek开放平台账号</p><p>可使用<strong>手机验证码</strong>/<strong>账号密码</strong>或<strong>扫描二维码</strong>登录注册</p><h3 id="充值余额" tabindex="-1">充值余额 <a class="header-anchor" href="#充值余额" aria-label="Permalink to &quot;充值余额&quot;">​</a></h3><p>登录后首页点击<code>去充值</code>按钮或访问<a href="https://platform.deepseek.com/top_up" target="_blank" rel="noreferrer">https://platform.deepseek.com/top_up</a>，选择自己需要充值的余额（测试程序的推荐充值1元测试）</p><h3 id="选择模型" tabindex="-1">选择模型 <a class="header-anchor" href="#选择模型" aria-label="Permalink to &quot;选择模型&quot;">​</a></h3><p>DeepSeek目前支持<code>deepseek-chat</code>和<code>deepseek-reasoner</code>模型，两者差异可在<a href="https://api-docs.deepseek.com/zh-cn/quick_start/pricing" target="_blank" rel="noreferrer">https://api-docs.deepseek.com/zh-cn/quick_start/pricing</a>查询，一般情况下使用<code>deepseek-chat</code>即可</p><h3 id="获取密钥" tabindex="-1">获取密钥 <a class="header-anchor" href="#获取密钥" aria-label="Permalink to &quot;获取密钥&quot;">​</a></h3><p>点击首页左侧<strong>API Keys</strong>或访问<a href="https://platform.deepseek.com/api_keys" target="_blank" rel="noreferrer">https://platform.deepseek.com/api_keys</a>进入密钥获取页面，点击<code>创建 API key</code>按钮创建新API Key，并保管好创建的API Key</p><blockquote><p>请将此 API key 保存在安全且易于访问的地方。出于安全原因，你将无法通过 API keys 管理界面再次查看它。如果你丟失了这个 key，将需要重新创建。</p></blockquote><div class="warning custom-block github-alert"><p class="custom-block-title">WARNING</p><p>请勿轻易将你的API Key发送给他人，请保管好你的API Key，防止泄露，否则可能会有财产损失的风险</p></div><h2 id="接入biliins" tabindex="-1">接入BiliIns <a class="header-anchor" href="#接入biliins" aria-label="Permalink to &quot;接入BiliIns&quot;">​</a></h2><h3 id="修改配置文件" tabindex="-1">修改配置文件 <a class="header-anchor" href="#修改配置文件" aria-label="Permalink to &quot;修改配置文件&quot;">​</a></h3><p>打开<code>setting.json</code>，修改<code>&quot;type&quot;: &quot;false&quot;,</code>为<code>&quot;type&quot;: &quot;deepseek&quot;,</code>，<code>&quot;key&quot;: &quot;&quot;,</code>修改为你刚才生成的API Keys，如<code>&quot;key&quot;: &quot;sk-eecc677190d34f99b4e5fc6c8b497700&quot;,</code></p><p>接下来，修改<code>&quot;AIName&quot;: &quot;deepseek-chat&quot;,</code>为你需要的模型名称，建议保持默认即可</p><h3 id="重启服务" tabindex="-1">重启服务 <a class="header-anchor" href="#重启服务" aria-label="Permalink to &quot;重启服务&quot;">​</a></h3><p>如果刚才已经启动了BiliIns服务，请将服务关闭后，重新运行<code>BiliIns.exe</code>或执行启动命令</p><h3 id="体验ai" tabindex="-1">体验AI <a class="header-anchor" href="#体验ai" aria-label="Permalink to &quot;体验AI&quot;">​</a></h3><p>尝试是否能正常使用AI功能，如果不出意外，此时将可以正常使用AI评论动向分析功能</p><p>如果不能正常使用，请将教程步骤重新执行，如果还是无法正常使用，请将页面截图、后台截图和日志文件（<code>logs</code>目录下）提交到<a href="https://github.com/ZeroMi-Studio/BiliIns/issues" target="_blank" rel="noreferrer">Issue</a>反馈</p>',22)]))}const u=a(s,[["render",p]]);export{k as __pageData,u as default};
